def extgcd(a, b):
    if b == 0:
        return 1, 0
    x, y = extgcd(b, a % b)
    return y, x - (a // b) * y


def mod_inverse(a, m):
    x, y = extgcd(a, m)
    return (m + x % m) % m


d = mod_inverse(e, phi)

m = pow(c, d, n)

